import React from 'react';
import { List } from 'antd';

class ListUsers extends React.Component {
  constructor(props) {
    super(props)
  }

  render() {
    return (
      <>
        <List
          dataSource={this.props.data}
          renderItem={item => (
            <List.Item>
              <a>{item}</a>
            </List.Item>
          )}
        />
      </>
    )
  }
}


